import logo from './logo.svg';
import './App.css';
import React,{ useState , useEffect } from "react";

function App() {

  const [list, setList] = useState(["Welcome to", "to-do list"]);

  return (
    <div className="App">
      <header className="App-header">
        <ul>
          { list.forEach( (item) => {
            <li>{item}</li>
            {console.log(item)}
          })}
        </ul>
      </header>
    </div>
  );
}

export default App;
